- input: "TEXT\x1CC00235739\x1C2\x1CA2009-4776578\x1CSA11AI\x1C\"This report is amended
    to correct the aggregate year-to-date contribution for Mark A. Schulze.  During
    a voluntary audit of the PAC's 2009 receipts, we became aware that we attributed
    a January 2009 contribution to Mark A. Schultz in Missouri which was actually
    collected from Mark A. Schulze in Texas.  Thus when Mr. Schulze contributed again
    in October 2009, he exceeded the annual individual contribution limit.  RAILPAC
    immediately issued a refund check to Mr. Schulze upon the discovery of the inadvertent
    excessive contribution.  This refund will be reported on the July Monthly Report
    due on July 20, 2010.  Also, today we amended the 2009 February Monthly Report
    to disclose the correct name and address for Mr. Schulze's January contribution.
    \ We have reviewed our audit steps for accepting contributions to help prevent
    this oversight in the future.  Please update your records accordingly.\"\n"
